description:
Veeram is a 2014 Tamil action masala film directed by Siva and produced by Vijaya Productions. The film features Ajith Kumar in the lead role, while an ensemble supporting cast includes Tamannaah, Vidharth, Bala, Santhanam, Nassar, Pradeep Rawat and Abhinaya, amongst others.

